<div class='question-begin'>Question 4</div><div class='question-body'>


Examine the fit of the CFA model of IQ.  
If it doesn't fit very well, consider checking for areas of local misfit (i.e., check your `modindices()`), and adjust your model accordingly.  


</div><p class="question-end"></p>




<div class="solution-begin"><button id='sol-start-4' class="jk-circle-right solution-icon clickable" onclick="toggle_visibility('sol-body-4', 'sol-start-4')">  Solution </button></div><div class="solution-body" id = "sol-body-4" style="display: none;">




::: {.cell layout-align="center"}

```{.r .cell-code}
fitmeasures(model_IQ.est)[c("rmsea","srmr","cfi","tli")]
```

::: {.cell-output .cell-output-stdout}
```
     rmsea       srmr        cfi        tli 
0.18443270 0.05713656 0.90826374 0.81652748 
```
:::
:::


The model doesn't fit very well so we could check the modification indices for local mis-specifications


::: {.cell layout-align="center"}

```{.r .cell-code}
modindices(model_IQ.est, sort=T) |> head()
```

::: {.cell-output .cell-output-stdout}
```
   lhs op rhs     mi    epc sepc.lv sepc.all sepc.nox
12 IQ1 ~~ IQ2 82.653  0.302   0.302    0.762    0.762
21 IQ4 ~~ IQ5 48.799  0.224   0.224    0.397    0.397
17 IQ2 ~~ IQ4 29.875 -0.166  -0.166   -0.349   -0.349
14 IQ1 ~~ IQ4 15.906 -0.138  -0.138   -0.268   -0.268
15 IQ1 ~~ IQ5 15.870 -0.132  -0.132   -0.279   -0.279
19 IQ3 ~~ IQ4 15.720  0.122   0.122    0.216    0.216
```
:::
:::


It looks like we might need to include residual covariances between the items IQ1 and IQ2 and maybe also between items IQ4 and IQ5. 
As always, we need to double check this makes substantive sense. Items IQ1 and IQ2 measure verbal comprehension and verbal memory - people might be likely to score low/high on both of these due to their verbal ability. IQ4 and IQ5 might be both related due to both being tests requiring visual perception?  


::: {.cell layout-align="center"}

```{.r .cell-code}
model2_IQ <- '
    IQ=~IQ1+IQ2+IQ3+IQ4+IQ5
    IQ1~~IQ2
    IQ4~~IQ5
'
model2_IQ.est <- cfa(model2_IQ, data=stress_IQ_data, estimator='MLR')
```
:::


The fit of the model is now much improved! and our loadings are all significant and $>|0.3|$.   

::: {.cell layout-align="center"}

```{.r .cell-code}
fitmeasures(model2_IQ.est)[c("rmsea","srmr","cfi","tli")]
```

